export default class extends React.Component {
    render() {
        return (
            <>
                <div class="container">
                    <div class="jumbotron">
                        <h1>Bootstrap Tutorial</h1>
                        <p>
                            Bootstrap is the most popular HTML, CSS, and JS framework for developing
                            responsive, mobile-first projects on the web.
                        </p>
                    </div>
                </div>
            </>
        );
    }
}
